/*Table structure for table `app_banners` */

DROP TABLE IF EXISTS `app_banners`;

CREATE TABLE `app_banners` (
  `idBanner` bigint(11) unsigned NOT NULL AUTO_INCREMENT,
  `tituloBanner` varchar(50) DEFAULT NULL,
  `fotoBanner` blob,
  `tipoLink` enum('producto','url') DEFAULT NULL,
  `linkBanner` text,
  `idPresentacion` bigint(20) DEFAULT NULL,
  `orden` int(11) DEFAULT '1',
  `idEstado` int(11) DEFAULT '1',
  PRIMARY KEY (`idBanner`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

